        <div>
        <img className="rounded-t-lg h-32 w-full" src={olxlogo} alt="" />
        </div>
        
    
    <div className="p-3 h-2/5">
        
            <h5 className="mb-1 text-xl  font-bold tracking-tight text-gray-900 dark:text-dark">Noteworthy</h5>
        
